const CigarSearch = () => {
    const [ text, setText ] = useState('')


    return (
        <div>
            <form>
                <input onChange={e => setText} type="search" placeholder='Search a Cigar...' />
                <button type='submit'>Search</button>
            </form>
        </div>
    )
}

export default CigarSearch
